import * as type from '../actions/ActionTypes';

export const getAllTasks = (all_tasks) => {
    return {
        type: type.GET_ALL_TASK,
        all_tasks
    };
};

export const editATask = (id) => {
    return {
        type: type.EDIT_A_TASK,
        id
    };
};
